        class=\"TSN1\" colspan=\"6\">\r\n<p></p>\r\nNOTES:\r\nThe Official World Golf
        Ranking is endorsed by the four Major Championships\r\nand the six professional
        tours, which make up the International Federation\r\nof PGA Tours, is issued
        every Monday following completion of the previous\r\nweek's tournaments from
        around the world. The official events from the six\r\nprofessional tours together
        with the PGA Tour Canada, Web.com and European\r\nChallenge Tours are all
        taken into account and points are awarded according to\r\nthe players' finishing
        positions and are generally related to the strength of\r\nthe field based
        on the number and ranking of the Top-200 World Ranked players\r\nand the Top-30
        of the Home Tour players in the respective tournaments (Event\r\n\"Ratings\").
        However, the four Major Championships are rated separately to\r\nreflect the
        higher quality of the events together with the Players\r\nChampionship in
        the United States. In addition, the BMW Championship in\r\nEurope the Australian,
        Japan and South African Open Championships and the\r\nFlagship events on the
        Asian and Web.com Tours are allocated higher minimum\r\npoints levels to reflect
        their status. The World Ranking points for each\r\nplayer are accumulated
        over a two-year \"rolling\" period with the points\r\nawarded for each tournament
        maintained for a 13-week period to place\r\nadditional emphasis on recent
        performances - ranking points are then reduced\r\nin equal decrements for
        the remaining 91 weeks of the two-year Ranking period.\r\nEach player is then
        ranked according to his average points per tournament\r\nwhich is determined
        by dividing his total number of points by the number of\r\ntournaments he
        has played over that two-year period. There is a minimum\r\ndivisor of 40
        tournaments over the two year ranking period. The winners of the\r\nMasters
        Tournament, the U.S. Open Championship, the Open Championship and the\r\nPGA
        Championship are awarded 100 points (60 points for 2nd place, 40 for 3rd\r\n30
        for 4th, down to 1.50 points for a player completing the final round) and\r\nthe
        winner of the Players Championship is awarded 80 points (points are\r\nawarded
        down to 1.20 points for 60th place and ties). The BMW Championship has\r\na
        minimum 64 points for the winner (points to 56th place). Minimum points\r\nlevels
        for the winners of official Tour events have been set at 6 points for\r\nthe
        PGA Tour Canada (points to 6th place), 12 points for the European\r\nChallenge
        Tour (points to 14th place), 14 points for the Asian, Sunshine and\r\nWeb.com
        Tours (points to 17th place), 16 points for Australasian and Japanese\r\nTours
        (points to 19th place) and 24 points for European and the United States\r\nTours
        (points to 27th place). In addition, the Open Championships of Australia\r\nJapan
        and South Africa have a minimum of 32 points for the winner (points to\r\n37th
        place) and the Flagship events on the Asian and Web.com Tours have a\r\nminimum
        of 20 points for the winner (points to 22nd place). In the cases of\r\nco-sanctioned
        Tour events the minimum points levels are determined using the\r\n\"average\"
        of the minimum Tour ranking points from each Tour (rounded up to\r\nnearest
        whole number). Points are reduced by 25% for tournaments curtailed to\r\n36
        holes because of inclement weather or other reasons.\r\n</td></tr>\r\n</table>\r\n<br><div
